import React from "react";
import "./ButtonsPrincipais.css";

const ButtonsPrincipais = () => {

    const handleWhatsAppClick = () => {
      window.location.href = 'https://wa.me/55 98 9101-0304';
    };

  return (
    <div className="div-btn">
      <button className="btn">Quero <p className="btn-p">Expor</p></button>
      <button className="btn">Como <p className="btn-p">Chegar</p></button>
      <button className="btn" onClick={handleWhatsAppClick}>Fale <p className="btn-p">Conosco</p></button>
    </div>
  );
};

export default ButtonsPrincipais;
